// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/token/ERC1155/utils/ERC1155Holder.sol";

contract F_NFT is ERC1155 {
    using Counters for Counters.Counter;
    Counters.Counter public tokenIds;

    mapping(uint256 => uint256) public idToQuantity;
    mapping(uint256 => string) private uris;

    string public name = "KHAASTEH";

    address public marketplace;

    constructor(address _marketplace) ERC1155("") {
        marketplace = _marketplace;
    }

    function mint(
        uint256 _amount,
        string memory _uri,
        bytes memory _data
    ) public {
        tokenIds.increment();
        uint256 newTokenId = tokenIds.current();

        _mint(msg.sender, newTokenId, _amount, _data);
        setApprovalForAll(marketplace, true);

        idToQuantity[newTokenId] = _amount;
        uris[newTokenId] = _uri;
    }

    function uri(
        uint256 _tokenId
    ) public view override returns (string memory) {
        return (uris[_tokenId]);
    }

    // function list(uint _tokenId, uint _price) public {
    //     bytes memory data = abi.encodePacked(_price);
    //     uint amount = balanceOf(msg.sender, _tokenId);
    //     safeTransferFrom(msg.sender, marketplace, _tokenId, amount, data);
    // }
}

contracts/Marketplace.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";

contract Marketplace is ReentrancyGuard {
    using Counters for Counters.Counter;

    Counters.Counter private itemIds; // Starting from one
    Counters.Counter private itemsSold;

    mapping(uint256 => MarketItem) private idToMarketItem; // Starts from one [1]

    // Sina Design
    mapping(address => mapping(uint => uint)) public pricePerToken; // contract address => token ID => price

    struct MarketItem {
        uint256 itemId; // Starts from one 1
        address nftContract;
        uint256 tokenId;
        uint256 amount;
        address payable seller;
        address payable owner;
        uint256 price;
        bool sold;
    }

    event MarketItemCreated(
        uint256 indexed itemId,
        address indexed nftContract,
        uint256 indexed tokenId,
        uint256 amount,
        address seller,
        address owner,
        uint256 price,
        bool sold
    );

    function onERC1155Received(
        address,
        address,
        uint256,
        uint256,
        bytes memory
    ) public virtual returns (bytes4) {
        return this.onERC1155Received.selector;
    }

    function createMarketItem(
        address _nftContract,
        uint256 _tokenId,
        uint256 _amount,
        uint256 _price
    ) public nonReentrant {
        itemIds.increment();
        uint256 itemId = itemIds.current();

        idToMarketItem[itemId] = MarketItem(
            itemId,
            _nftContract,
            _tokenId,
            _amount,
            payable(msg.sender),
            payable(address(0)),
            _price,
            false
        );

        IERC1155(_nftContract).safeTransferFrom(
            msg.sender,
            address(this),
            _tokenId,
            _amount,
            ""
        );

        emit MarketItemCreated(
            itemId,
            _nftContract,
            _tokenId,
            _amount,
            msg.sender,
            address(0),
            _price,
            false
        );

        // Sine Design
        pricePerToken[_nftContract][_tokenId] = _price;
    }

    function createMarketSale(
        address _nftContract,
        uint256 _itemId
    ) public payable nonReentrant {
        uint256 price = idToMarketItem[_itemId].price;
        uint256 tokenId = idToMarketItem[_itemId].tokenId;
        uint256 amount = idToMarketItem[_itemId].amount;

        require(
            msg.value == price,
            "Please provide the asking price in order to complete the purchase"
        );

        idToMarketItem[_itemId].seller.transfer(msg.value);
        ERC1155(_nftContract).safeTransferFrom(
            address(this),
            msg.sender,
            tokenId,
            amount,
            ""
        );
        idToMarketItem[_itemId].owner = payable(msg.sender);
        idToMarketItem[_itemId].sold = true;
        itemsSold.increment();

        // Sina Design
        pricePerToken[_nftContract][tokenId] = 0;
    }

    function fetchMarketItems() public view returns (MarketItem[] memory) {
        uint256 itemCount = itemIds.current();
        uint256 unsoldItemCount = itemIds.current() - itemsSold.current();
        uint256 currentIndex = 0;

        MarketItem[] memory items = new MarketItem[](unsoldItemCount);

        for (uint256 i = 0; i < itemCount; i++) {
            if (idToMarketItem[i + 1].owner == address(0)) {
                uint256 currentId = idToMarketItem[i + 1].itemId;
                // Why we use storage keyword for storing this variable?
                // ??????
                MarketItem storage currentItem = idToMarketItem[currentId];
                items[currentIndex] = currentItem;
                currentIndex += 1;
            }
        }
        return items;
    }

    function fetchMyNFTs() public view returns (MarketItem[] memory) {
        uint256 totalItemCount = itemIds.current();
        uint256 itemCount = 0;
        uint256 currentIndex = 0;

        for (uint256 i = 0; i < totalItemCount; i++) {
            if (idToMarketItem[i + 1].owner == msg.sender) {
                itemCount += 1;
            }
        }

        MarketItem[] memory items = new MarketItem[](itemCount);

        for (uint256 i = 0; i < totalItemCount; i++) {
            if (idToMarketItem[i + 1].owner == msg.sender) {
                uint256 currentId = idToMarketItem[i + 1].itemId;
                MarketItem storage currentItem = idToMarketItem[currentId];
                items[currentId] = currentItem;
                currentIndex += 1;
            }
        }

        return items;
    }

    function fetchItemsCreated() public view returns (MarketItem[] memory) {
        uint256 totalItemCount = itemIds.current();
        uint256 itemCount = 0;
        uint256 currentIndex = 0;

        for (uint256 i = 0; i < totalItemCount; i++) {
            if (idToMarketItem[i + 0].seller == msg.sender) {
                itemCount += 1;
            }
        }

        MarketItem[] memory items = new MarketItem[](itemCount);

        for (uint256 i = 0; i < totalItemCount; i++) {
